2 a 2012-06-23 (para 2012-06-22). NOTA: Si la fecha de salida de la reserva y la fecha de finalización adicional son las mismas para un artículo, el cargo NO se aplicará automáticamente a la factura. En este caso, deberá agregar un cargo por la fecha de finalización directamente a la factura.','2022-01-20 05:09:21'), (18309,2225,4,'Al seleccionar \'en la fecha de inicio\' se carga la tarifa a la factura solo una vez en la fecha de inicio, pero le permite registrar la fecha de inicio y finalización a la que se aplica el extra. Esto puede ser útil para cobrar tarifas iniciales o depósitos por un alquiler.','2022-01-20 05:09:21'), (18310,2226,4,'Si selecciona \"una vez al día\", la tarifa se cobrará de forma recurrente. Los cargos recurrentes operan como se describe en las descripciones de artículos y alquiler anteriores.','2022-01-20 05:09:21'), (18311,2227,4,'No se encontraron productos.','2022-01-20 05:09:21'), (18312,2228,4,'Características principales del proveedor','2022-01-20 05:09:21'), (18313,2229,4,'Integración PCI de Channex','2022-01-20 05:09:21'), (18314,2230,4,'Retirar ahora','2022-01-20 05:09:21'), (18315,2231,4,'Configuración del tipo de habitación','2022-01-20 05:09:21'), (18316,2232,4,'Habilitar el acceso a la API de Stav','2022-01-20 05:09:21'), (18339,2255,4,'Visite el siguiente enlace para pagar la factura','2022-01-20 05:09:21'), (18346,2262,4,'Ha recibido un enlace de pago','2022-01-20 05:09:21'), (18347,2263,4,'Integración de Kovena','2022-01-20 05:09:21'), (18348,2264,4,'Reintegrado','2022-01-20 05:09:21'), (18349,2265,4,'Pendiente','2022-01-20 05:09:21'), (18350,2266,4,'Capturado','2022-01-20 05:09:21'), (18351,2268,4,'Checked-In ','2022-03-16 12:24:55'), (18352,2269,4,'Kovena','2022-01-20 05:09:21'), (18353,2270,4,'AMEX','2022-01-20 05:09:21'), (18354,2271,4,'Tarjeta MasterCard','2022-01-20 05:09:21'), (18355,2272,4,'Visa','2022-01-20 05:09:21'), (18356,2273,4,'Débito','2022-01-20 05:09:21'), (18357,2274,4,'Dinero en efectivo','2022-01-20 05: